Action.Parameter:
/* Initialize global var 'documentId'. After initialization it's incremented once for every record read so all doc_Id for a given batch are sequential */
Dim dateToday, timeNow
dateToday = DateConvert("yyyy/mm/dd","yyyymmdd", Date()) timeNow = Time() documentId = dateToday & Hour(timeNow) & Minute(timeNow) & Second(timeNow) & "000"
